import React from "react";
import logo from "./logo.svg";
import "./App.css";
const styles = {
  text: {
    textAlign: "center",
  },

  shopimage: {
    display: "block",
    marginLeft: "auto",
    marginRight: "auto",
    width: "50%",
  },

  prodimag: {
    width: "200px",
    height: "200px",
  },
};
function App() {
  return (
    <div>
      <div>
        <img
          src="https://images.squarespace-cdn.com/content/v1/569ede52b20943c52005dd02/1473886777959-747QI1IHVYIL59RC8072/ke17ZwdGBToddI8pDm48kLxnK526YWAH1qleWz-y7AFZw-zPPgdn4jUwVcJE1ZvWEtT5uBSRWt4vQZAgTJucoTqqXjS3CfNDSuuf31e0tVH33scGBZjC30S7EYewNF5iKKwhonf2ThqWWOBkLKnojuqYeU1KwPvsAK7Tx5ND4WE/image-asset.jpeg"
          alt="logo"
          style={styles.shopimage}
        />
        <h1 style={styles.text}>Welone to our Shop</h1>
      </div>

      <div>
        <img
          src="https://www.ikea.com/kw/en/images/products/fixa-17-piece-tool-set__0711971_PE728599_S5.JPG"
          alt="tools"
          style={styles.prodimag}
        />
        <div style={styles.text}>
          <p>Tools Box</p>
          <p> PRICE 30 KD</p>
        </div>
      </div>
    </div>
  );
}

export default App;
